class Restante extends Component{
  render(){
    const presupuesto = this.props.presupuesto;
    const restante = this.props.restante;
    return(
      <div className = "alert alert-success">
        <p>Restante: $ {this.restante}</p>
      </div>
    )
  }
}

export default Restante;
